import Router from 'next/router';
const ticketDetails = ({currentUser,ticket,errors})=>{

    if(!currentUser){
        Router.push('/sign-in');
    }
    const listError = !errors?null:

        <div className="alert alert-danger" role="alert">
            <ul className="my-0">
                {
                    errors.map((e,ind)=>{
                    return <li key={ind}>{e.message}</li>;
                    })
                }
            </ul>
        </div>
    return (
            <div>
                <h1>Tickets</h1>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {/* {tableContent} */}
                    </tbody>
                </table>
                {listError}
            </div>
        );
}; 




ticketDetails.getInitialProps = async (context,client,currentUser)=>{
    try{
        const data = await client.get('/api/ticket/v1/get-ticket/'+context.query.ticketId);
        console.log('res',data.data);
        return {ticket:data.data.ticket};
    }catch(err){
        return {errors:err.response.data.errors};
    }
}

export default ticketDetails;
